CREATE TABLE mytable(
   order_number VARCHAR(4) NOT NULL PRIMARY KEY
  ,date         VARCHAR(24) NOT NULL
  ,warehouse    VARCHAR(7) NOT NULL
  ,client_type  VARCHAR(9) NOT NULL
  ,product_line VARCHAR(21) NOT NULL
  ,quantity     INTEGER  NOT NULL
  ,unit_price   NUMERIC(5,2) NOT NULL
  ,total        NUMERIC(7,2) NOT NULL
  ,payment      VARCHAR(11) NOT NULL
  ,payment_fee  NUMERIC(4,2) NOT NULL
);
